import { useContext } from "react";
import { CoreAssistantContext } from "../../pages";
import { CoreAssistantDTO } from '../../statics/definitions.dto';

const Sidebar = () => {
  const assistants: CoreAssistantDTO[] = useContext(CoreAssistantContext)

  return (
    <aside style={{ width: '30%', overflow: 'auto' }}>
      {assistants.map(a => <div key={a.packageName}>{a.packageName}</div>)}
    </aside>
  )
};

export default Sidebar;
